import React from 'react';
import './Navbar.css';
import { FaWifi, FaBatteryFull } from 'react-icons/fa'; // Importing FontAwesome WiFi and Battery icons

const Navbar = () => {
  return (
    <div className="navbar-container">
      <img className='logo' src="./assets/Apple Logo.svg" alt="Logo" />
      <div className="navbar-right">
        <FaWifi className="navbar-icon" />
        <FaBatteryFull className="navbar-icon" />
        <p className="navbar-text">Sat Dec 28 4:18 PM</p>
      </div>
    </div>    
  );
};

export default Navbar;
